import "./Achievments.css";
const Achievments = () => {
  return (
    <div className="achievments">
      <div className="achievments-child" />
      <div className="achievements">Achievements</div>
      <img className="silver-medal-icon" alt="" src="/silver-medal.svg" />
      <img className="award-5-icon" alt="" src="/award-5.svg" />
      <img className="tropy-star-icon" alt="" src="/tropy-star.svg" />
      <img className="trophy-cup-icon" alt="" src="/trophy-cup.svg" />
    </div>
  );
};

export default Achievments;
